	// 接到 message 要做什麼事的 function
	function receiveMessage(e) {
		const allowOrigin = ['http://localhost:4200']; // 建議用設定檔，未來會變更

		// 如果不是我們要的來源，就不做事
		if (!allowOrigin.includes(e.origin)) {
			// console.error('資料來源錯誤', e.origin);
			return false;
		}
		// 來源網址是指定的網域時
		else {
			console.log('receiveMessage', e);
			// 拿傳來的參數（e.data）
			console.log('data', e.data);
			const data = e.data;
			if (data.name === 'reload') {
				console.log('reload');
				window.location.reload();
			} else if (data.name === 'getSaveToken') {
				hideLoading();
			} else if (data.name === 'cameraPicture') {
				document.getElementById('photo').src = data.params.base64Image;
			}
		}
	}

	// 監聽 message 事件
	window.addEventListener('message', receiveMessage, false);

	// 更新載入時間
	function updateLoadTime() {
		var now = new Date();
		var time = now.getHours() + ':' + now.getMinutes() + ':' + now.getSeconds();
		document.getElementById('loadTime').innerHTML = time;
	}

	function showLoading() {
		$("#status").fadeIn();
		$("#preloader").fadeIn();
	}

	function hideLoading() {
		$("#status").fadeOut();
		$("#preloader").delay(500).fadeOut("slow");
	}
